  true,\n\t\"url\": null,\n\t\"notes\": \"Final Report for the DOE Innovative Exploration
  Technology (IET) Grant 109 program supporting geothermal exploration of Newberry
  Volcano, Oregon.nnAbstract:  Davenport Newberry (Davenport) has completed 8 years
  of exploration for geothermal energy on Newberry Volcano in central Oregon. Two
  deep exploration test wells were drilled by Davenport on the west flank of the volcano,
  one intersected a hydrothermal system; the other intersected isolated fractures
  with no hydrothermal interconnection. Both holes have bottom-hole temperatures near
  or above 315u00b0C (600u00b0F). Subsequent to deep test drilling an expandednexploration
  and evaluation program was initiated. These efforts have included reprocessing existing
  data, executing multiple geological, geophysical, geochemical programs, deep exploration
  test well drilling and shallow well drilling. The efforts over the last three years
  have been made possible through a DOE Innovative Exploration Technology (IET) Grant
  109, designed to facilitate innovative geothermal exploration techniques. The combined
  results of the last 8 years have led to a better understanding of the history and
  complexity of Newberry Volcano and improved the design and interpretation of geophysical
  exploration techniques with regard to blind geothermal resources in volcanic terrain.\",\n\t\"license_title\":
